    constructor() {
        this.all_valid_words = [];
        this.all_valid_word_map={};


        for (var i = 0; i < wordle_5.all_5.length; i++) {
               if (/^[a-z]+$/.test(wordle_5.all_5[i])) {
                    this.all_valid_words.push(wordle_5.all_5[i]);
                    this.all_valid_word_map[wordle_5.all_5[i]]=true;
                }
        }
        this.thumb = this.ran_index(this.all_valid_words.length);
        console.log("hidden is no more hidden:",this.all_valid_words[((this.thumb*7+107)%this.all_valid_words.length)]);
    }

    ran = (mn, mx) => {
        return Math.random() * (mx - mn) + mn;
    }
    ran_index = (max_index) => {
        return Math.floor(this.ran(1, max_index)) - 1;
    }

    interactor(guessed_word){
        var hid=this.all_valid_words[((this.thumb*7+107)%this.all_valid_words.length)];
        console.log("hid:",hid);
        guessed_word = guessed_word.toLowerCase();
        if(this.all_valid_word_map[guessed_word]!=true || guessed_word.length!=hid.length){
             return [];
        }
        if (guessed_word === hid) {
            return [9];
        }
        var ans = 0;
        //looking for exact match
        var exact_match = [], actual_used = [];
        for (var i = 0; i < hid.length; i++) {
            if (hid[i] === guessed_word[i]) {
                exact_match.push(1);
                actual_used.push(1);
            } else {
                exact_match.push(0);
                actual_used.push(0);
            }
        }

        //looking for match not in match
        for (var i = 0; i < guessed_word.length; i++) {
            if (!exact_match[i])
                for (var j = 0; j < hid.length; j++) {
                    if (!actual_used[j]) {
                        if (guessed_word[i] == hid[j]) {
                            actual_used[j] = true;
                            exact_match[i] = 2;
                            break;
                        }
                    }
                }
        }
        // 0 -> not in word
        // 1 -> exact position match
        // 2 -> in word match
        return exact_match;
    };

